import React from "react";
import {useNavigate} from "react-router-dom";

export const HomePage = () => {
    const navigate =useNavigate()
    const irParaListaDeViagens = () => {

        navigate("/trips/list")
    }
    return (
        <div>
            <p>HomePage</p>
            <button onClick={irParaListaDeViagens}>Viagens</button>
        </div>
    )
}
